import React, { Component } from 'react';
import Navbar from '../components/Layout/Navbar';
import Banner from '../components/HoneOne/Banner';
import FeaturedServices from '../components/HoneOne/FeaturedServices';
import PartnerSlider from '../components/Common/Partner/PartnerSlider';
import OurServices from '../components/HoneOne/OurServices';
import OurFeaturesTab from '../components/Common/OurFeaturesTab';
import FunFacts from '../components/Common/FunFacts';
import ProjectGallerySlider from '../components/Common/ProjectGallerySlider';
import OurTeam from '../components/Common/OurTeam';
import Solution from '../components/Common/Solution';
import Testimonials from '../components/Common/Testimonials';
import Pricing from '../components/Common/Pricing';
import SubscribeFluid from '../components/Common/SubscribeFluid';
import LatestNews from '../components/Common/LatestNews';
import Footer from '../components/Layout/Footer';

class Index extends Component {
    render() {
        return (
            <React.Fragment> 
                <Navbar />
                <Banner />
                {/* <FeaturedServices /> */}
                {/* <PartnerSlider /> */}
                <OurServices />
                <OurFeaturesTab />
                <FunFacts />
                <ProjectGallerySlider />
                {/* <OurTeam /> */}
                <Solution />
                {/* <Testimonials /> */}
                {/* <Pricing /> */}
                <SubscribeFluid />
                {/* <LatestNews /> */}
                <Footer />
            </React.Fragment>
        );
    }
}

export default Index;
